CREATE TABLE `ALERT_MASTER` (
  `COD_ALERT_MASTER` INTEGER(16) NOT NULL AUTO_INCREMENT COMMENT 'CLAVE PRIMARIA DE LAS ALERTAS POR CLIENTE',
  `NAME_ALERT` VARCHAR(60) COLLATE latin1_swedish_ci NOT NULL,
  `COD_CLIENT` INTEGER(11) NOT NULL,
  `COD_USER_CREATE` INTEGER(11) NOT NULL COMMENT 'USUARIO CREADOR',
  `COD_EVENT_GENERATE` INTEGER(11) NOT NULL COMMENT 'EVENTO GENERADO, DEBE TENER INFORMACION SI FLAG_SAVE_HIST = 1 O FLAG_SHOW_CONSOLE = 1',
  `HORARIO_FLAG_LUNES` INTEGER(1) DEFAULT '0',
  `HORARIO_FLAG_MARTES` INTEGER(1) DEFAULT '0',
  `HORARIO_FLAG_MIERCOLES` INTEGER(1) DEFAULT '0',
  `HORARIO_FLAG_JUEVES` INTEGER(1) DEFAULT '0',
  `HORARIO_FLAG_VIERNES` INTEGER(1) DEFAULT '0',
  `HORARIO_FLAG_SABADO` INTEGER(1) DEFAULT '0',
  `HORARIO_FLAG_DOMINGO` INTEGER(1) DEFAULT '0',
  `HORARIO_HORA_INICIO` TIME DEFAULT '00:00:00' COMMENT 'FRACCIONES DE MEDIA HORA',
  `HORARIO_HORA_FIN` TIME DEFAULT '00:00:00' COMMENT 'FRACCIONES DE MEDIA HORA',
  `EMAIL_FROMTO` TEXT COLLATE latin1_swedish_ci COMMENT 'DESTINATARIOS DEL CORREO',
  `ACTIVE` INTEGER(11) NOT NULL,
  `FLAG_SAVE_HIST` INTEGER(1) DEFAULT '1' COMMENT 'SI ESTA EN 1, ALMACENA RESULTADO EN EL HISTÓRICO X FLOTA',
  `FLAG_SHOW_CONSOLE` INTEGER(1) DEFAULT '1' COMMENT 'SI ESTA EN 1, ALMACENA RESULTADO EN EL HISTÓRICO X USUARIO',
  `FECHA_CREATE` DATETIME DEFAULT NULL COMMENT 'FECHA HORA DE CREACIÓN DE ESTA ALERTA',
  `ALARM_EXPRESION` TEXT COLLATE latin1_swedish_ci COMMENT 'EXPRESION DE LA ALARMA, SI ES TRUE, SE APLICA; ESTA EXPRESION DEBE FUNCIONAR PARA SER EVALUADA POR UN WHERE DE UN SELECT DE MYSQL',
  `FLAG_SEND_SMS` INTEGER(1) DEFAULT '0',
  `SMS_EXPRESION` VARCHAR(300) COLLATE latin1_swedish_ci DEFAULT NULL,
  `FLAG_SAVE_EVENT_CRITIC` INTEGER(1) DEFAULT '0',
  `TYPE_EXPRESION` ENUM('P','R','G','U') DEFAULT NULL COMMENT 'P= PDI,R= RSI,G= GEOCERCAS,U = UNIDAD',
  `PK_EXPRESION` INTEGER(20) DEFAULT NULL COMMENT 'DEPENDE DEL TIPO DE EXPRESION, SI E P SE ALMACENA EL PK DEL PDI, SI ES R EL PK DEL RSI SI ES G EL PK DEL GEO, SI ES U EL PK DE LA UNIDAD',
  `FLAG_MSG_IN` INTEGER(1) DEFAULT NULL COMMENT '1 PARA ALMACENAR EN TABLA MENSAJES ENTRANTES',
  `EXPRESION_MSG_IN` VARCHAR(300) COLLATE latin1_swedish_ci DEFAULT NULL,
  `FLAG_MSG_OUT` INTEGER(1) DEFAULT NULL COMMENT '1 PARA ALMACENAR EN TABLA MENSAJES SALIENTES Y MANDARSELO A LA UNIDAD COM MENSAJE',
  `EXPRESION_MSG_OUT` VARCHAR(300) COLLATE latin1_swedish_ci DEFAULT NULL,
  `CORREOS_ASIGNADOS` INTEGER(2) DEFAULT NULL,
  `CORREOS_VALIDADOS` INTEGER(2) DEFAULT NULL
)ENGINE=MyISAM COMMENT='prueba' CHECKSUM=0 DELAY_KEY_WRITE=0 PACK_KEYS=0 MIN_ROWS=0 MAX_ROWS=0 ROW_FORMAT=DYNAMIC CHARACTER SET 'latin1'
COLLATE 'latin1_swedish_ci';

COMMIT;



